import Layout from '../components/Layout';

const Photo = () => (
  <Layout>
    <div>
      <h1>Go take a look at my pictures</h1>
      <p>Helicopters pictures

          <br/>Instagram: <a href="http://instagram.com/airheliny"> AirHeliNY</a>

      </p>
    </div>
  </Layout>
);

export default Photo;
